import woman from "../assets/images/Group 6.png";

const WaitingList = () => {
    return (
        <section>
            <div className="w-full">
                <div className="w-1/2 pr-[40px] mt-auto mb-auto">
                    <img src={woman} alt="woman" />
                </div>
            </div>

        </section>
    );
};

export default WaitingList;
